    function isLocked(uint256 tokenId)external view returns (bool) {
         require(_exists(tokenId), "isLocked: nonexistent token");
         return tokenLockState[tokenId];
    }

    function setLocked(uint256 tokenId, bool state) external {
        require(paused == false, "Contract Paused");
         require(_exists(tokenId), "setLocked: nonexistent token");
        //  require( (msg.sender == super.ownerOf(tokenId)) || (msg.sender == super.owner()), 
        //  "Only Token owner or contract owner may change lock");
        require( _isApprovedOrOwner(msg.sender, tokenId) , "Only Token owner may set lock");
         
         
         tokenLockState[tokenId] = state;
    }

    function tokenURIPrefix() external view returns (string memory){
        return _tokenURIPrefix;
    } 

    function setTokenURIPrefix(string memory _prefix) external onlyOwner {
        //require(paused == false, "Contract Paused");
        _tokenURIPrefix = _prefix;
    } 

    function tokenURI(uint256 tokenId) public view override returns (string memory) {
        string memory _tokenURI = super.tokenURI(tokenId);
        return string(abi.encodePacked(_tokenURIPrefix, _tokenURI));
    }

    function rawTokenURI(uint256 tokenId) public view returns (string memory) {
        return super.tokenURI(tokenId);
    }

    function transferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        require(paused == false, "Contract Paused");
        require(_exists(tokenId), "Showcase721 transferFrom: operator query for nonexistent token");
        require(!tokenLockState[tokenId], "Showcase721 transferFrom: token locked");
        super.transferFrom(from, to, tokenId);
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId
    ) public virtual override {
        super.safeTransferFrom(from, to, tokenId, "");
    }

    function safeTransferFrom(
        address from,
        address to,
        uint256 tokenId,
        bytes memory _data
    ) public virtual override {
        require(paused == false, "Contract Paused");
        require(_exists(tokenId), "Showcase721 safeTransferFrom: operator query for nonexistent token");
        require(!tokenLockState[tokenId], "Showcase721 safeTransferFrom: token locked");
        require(_isApprovedOrOwner(_msgSender(), tokenId), "Showcase721: transfer caller is not owner nor approved");
        super.safeTransferFrom(from, to, tokenId, _data);
    }

    function exists(uint256 tokenId) external view virtual returns (bool) {
        return super._exists(tokenId);
    }
}

